sys_variable_value.value:
(function execute(inputs, outputs) {
  if(inputs.status_code == '200'){
  	var responseObject = JSON.parse(inputs.response_body);
  	outputs.count = responseObject.count;
  	outputs.next = responseObject.next;
   	//outputs.encodedquery = v_query.getEncodedQuery()
  }
})(inputs, outputs);

